<h1 class="Section4">
<a class="Section5" href="#" id="utilisation-d-une-liaison-bluetooth--qtbluetooth-">Utilisation d'une liaison Bluetooth (QtBluetooth)</a>
</h1>
<div class="Section6"><br>L'API Bluetooth fournit une connectivité entre les appareils compatibles Bluetooth.<br><br>Bluetooth est une technologie sans fil à courte portée (moins de 100 mètres). Il a un taux de transfert de données de 2,1 Mbps, ce qui le rend idéal pour transférer des données entre appareils. La connectivité Bluetooth est basée sur la gestion de base des appareils, telle que la recherche d'appareils, la collecte d'informations à leur sujet et l'échange de données entre eux.<br><br>Qt Bluetooth prend en charge le développement Bluetooth Low Energy pour les cas d'utilisation de rôle client/central.<br>&nbsp;&nbsp;<br><div class="GSummary2"><div class="GSummary21 Summary4">
<i class="Summary5 fa fa-book"></i>
